
const FlightSearchController = require('../Controllers/Flight_Search_Controller');
const {onCreatePayloadData}  = require('../Utility/Payloads/Flight_Search');
const {onRetrieveEndPoints}  = require('../Utility/EndPoints');
const {onCreateFlightSearchResponseData} =require('../Utility/Response/Flight_Search');
if(process.env.NODE_ENV !=="PROD"){
    require('dotenv').config();
}
const SearchFlightsInputs =(req,res)=>{

    let qObj ={};

    qObj.Adults       = req.body.Adults;
    qObj.Childrens    = req.body.Childs;
    qObj.Infants      = req.body.Infants;
    qObj.TicketClass  = req.body.Class;
    qObj.TripType     = req.body.TripType;
    qObj.OriginDest   = req.body.OriginDest;
    
    
    // check user pass any preffered airlines code or not
    if(req.body.PreferAirlineCodes){
        
        console.log(req.body.PreferAirlineCodes);
        qObj.PeferAirlineCodes = req.body.PreferAirlineCodes;

    }else{
        qObj.PeferAirlineCodes =[];
    }

    //qObj.Payload      = onCreatePayloadData(qObj);
    //console.log(JSON.stringify(qObj.Payload));

    onCreatePayloadData(qObj).then(r =>{
        qObj.Payload = r;
        if(process.env.NODE_ENV !=="PROD"){
            qObj.secrect_key = process.env.DEV_API_KEY;
            qObj.api_endPoint = onRetrieveEndPoints("flight_search");
            qObj.apiURL = process.env.DEV_URL+ qObj.api_endPoint ;
        }else{
            qObj.secrect_key = process.env.PROD_API_KEY;
            qObj.api_endPoint = onRetrieveEndPoints("flight_search");
            qObj.apiURL = process.env.PROD_URL+ qObj.api_endPoint ;
        }


            const oSearch = new FlightSearchController(qObj);
            oSearch.onRetrieveApisDataForFlights().then(result =>
            {
                        if(result.status === 200)
                        {
                        
                            //res.status(200).json({success:true,Results:result.data});
                            onCreateFlightSearchResponseData(result.data,qObj).then(r =>{
                                res.status(200).json(r);
                            });

                        

                        }else{
                        
                            res.status(500).json({
                                success:false,
                                errorMessage:result.statusText
                            });
                        }

            });

    });

       
}

const TestSearchFlightsInputs =(req,res)=>{

    let qObj ={};

    qObj.Adults       = req.body.Adults;
    qObj.Childrens    = req.body.Childs;
    qObj.Infants      = req.body.Infants;
    qObj.TicketClass  = req.body.Class;
    qObj.TripType     = req.body.TripType;
    qObj.OriginDest   = req.body.OriginDest;
    
    
    // check user pass any preffered airlines code or not
    if(req.body.PreferAirlineCodes){
        
        console.log(req.body.PreferAirlineCodes);
        qObj.PeferAirlineCodes = req.body.PreferAirlineCodes;


    }else{
        qObj.PeferAirlineCodes =[];
    }


    onCreatePayloadData(qObj).then(r =>{
        qObj.Payload = r;

        let oRes = getResponseObjectForReturn();
        //let oRes = getResponseObjectForMutiCity();
        onCreateFlightSearchResponseData(oRes.Results,qObj).then(r =>{
            console.log(r.data.length);
            res.status(200).json(r);
        });


    });
}

module.exports={SearchFlightsInputs,TestSearchFlightsInputs};

